    "    cleaned_lines = [line for line in lines if not json_pattern.search(line)]\n",
    "\n",
    "    with open(output_file, \"w\") as f:\n",
    "        f.writelines(cleaned_lines)\n",
    "\n",
    "    print(f\"Cleaned script saved to: {output_file}\")\n",
    "\n",
